import React, { useState } from 'react';
import axios from 'axios';
import './Excel.css';

function App() {
  const [file, setFile] = useState(null);

  const [data, setData] = useState({
    all: 0,
    rto_complete: 0,
    door_step_exchanged: 0,
    delivered: 0,
    cancelled: 0,
    rto_locked: 0,
    ready_to_ship: 0,
    shipped: 0,
    rto_initiated: 0,
    other: 0,
    supplier_listed_price_total: 0,
    supplier_discounted_price_total: 0
  });

  const [dragActive, setDragActive] = useState(false);

  const handleFileChange = (e) => {
    const selectedFile = e.target.files?.[0];
    if (selectedFile && /\.(csv|xlsx?|xls)$/i.test(selectedFile.name)) {
      setFile(selectedFile);
    } else {
      alert('Please upload a valid CSV or Excel file');
    }
  };

  const handleDrop = (e) => {
    e.preventDefault();
    setDragActive(false);
    const droppedFile = e.dataTransfer.files?.[0];
    if (droppedFile && /\.(csv|xlsx?|xls)$/i.test(droppedFile.name)) {
      setFile(droppedFile);
    } else {
      alert('Only .csv or .xlsx files are supported');
    }
  };

  const handleDragOver = (e) => {
    e.preventDefault();
    setDragActive(true);
  };

  const handleDragLeave = () => {
    setDragActive(false);
  };

  const handleUpload = async () => {
    if (!file) {
      alert('Please upload a file first');
      return;
    }

    const formData = new FormData();
    formData.append('file', file);

    try {
      const res = await axios.post('http://localhost:5000/upload', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });

      const result = res.data;

      setData({
        all: result.all?.length || 0,
        rto_complete: result.rto_complete?.length || 0,
        door_step_exchanged: result.door_step_exchanged?.length || 0,
        delivered: result.delivered?.length || 0,
        cancelled: result.cancelled?.length || 0,
        rto_locked: result.rto_locked?.length || 0,
        ready_to_ship: result.ready_to_ship?.length || 0,
        shipped: result.shipped?.length || 0,
        rto_initiated: result.rto_initiated?.length || 0,
        other: result.other?.length || 0,
        supplier_listed_price_total: Number(result.totals?.totalSupplierListedPrice || 0),
        supplier_discounted_price_total: Number(result.totals?.totalSupplierDiscountedPrice || 0)
      });
    } catch (err) {
      console.error('Upload failed', err);
      alert('Upload failed');
    }
  };

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-logo">Meesho</div>
        <div className="navbar-links">
          <a href="/">Home</a>
          <a href="/">Upload</a>
          <a href="/">Dashboard</a>
        </div>
      </nav>

      <h1 className="heading">Product Status Dashboard</h1>

      <div className="status-boxes">
        {[
          { label: 'All', value: data.all },
          { label: 'RTO Complete', value: data.rto_complete },
          { label: 'Door Step Exchanged', value: data.door_step_exchanged },
          { label: 'Delivered', value: data.delivered },
          { label: 'Cancelled', value: data.cancelled },
          { label: 'RTO Locked', value: data.rto_locked },
          { label: 'Pending', value: data.ready_to_ship },
          { label: 'Shipped', value: data.shipped },
          { label: 'RTO Initiated', value: data.rto_initiated },
          { label: 'Other', value: data.other },
          { label: 'Supplier Listed Total Price (Incl. GST + Commission)', value: data.supplier_listed_price_total.toLocaleString() },
          { label: 'Supplier Discounted Total Price (Incl GST and Commission)', value: data.supplier_discounted_price_total.toLocaleString() }
        ].map((item, idx) => (
          <div key={idx} className="box other">
            {item.label}<br />
            <span>{item.value}</span>
          </div>
        ))}
      </div>

      <div
        className={`upload-section ${dragActive ? 'drag-active' : ''}`}
        onDrop={handleDrop}
        onDragOver={handleDragOver}
        onDragLeave={handleDragLeave}
      >
        <p>Drag and drop your CSV or Excel file here or</p>
        <input type="file" accept=".csv, .xlsx, .xls" onChange={handleFileChange} />
        {file && <p className="filename">Selected File: {file.name}</p>}
        <button onClick={handleUpload}>Upload File</button>
      </div>
    </div>
  );
}

export default App;
